import React, { useState, useEffect } from 'react';
import axios from 'axios';

const ApiComponent = () => {
  const [userData, setUserData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const result = await axios.get('http://localhost:5000/income/BMW-Mercedes');
      setUserData(result.data);
    };
    fetchData();
  }, []);

  return (
    <div>
      <h2>User Data:</h2>
      <table>
        <thead>
          <tr>
            <th>id</th>
            <th>income</th>
            <th>car</th>
          </tr>
        </thead>
        <tbody>
          {userData.map((user, index) => (
            <tr key={index}>
              <th>{user.id}</th>
              <td>{user.income}</td>
              <td>{user.car}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ApiComponent;
